import { useState } from "react";
import { useForm } from "react-hook-form";
import {
  Constants,
  inputDataDelivery,
  inputDataPersonal,
  inputDataSpecial,
  orderForm,
} from "../styles/Constants";
import { setInputs } from "./functions/setInputsToForm";
import { popupBlock } from "./PopupBlock";
import { GridBox2 } from "../style";
import { FormBox, FormSpecialBox } from "../styles/OrderTrans";
import { GrayButtonInput } from "../styles/Input";
import { InputSectionText } from "../styles/TextStyles";

export const Form = ({ xxx }: any) => {
  const {
    register,
    setValue,
    handleSubmit,
    getValues,
    formState: { errors },
  } = useForm<typeof xxx>();
  const onSubmit = (data: any) => console.log(getValues);
  const [popup, setPopup] = useState({ isActive: false, variant: "" });

  return (
    <>
      {popupBlock(popup, handleSubmit(onSubmit), register, setPopup)}
      <GridBox2 onSubmit={handleSubmit(onSubmit)}>
        {orderForm.data.map((item) => console.log(item.section))}
        <GrayButtonInput type="submit" />
      </GridBox2>
    </>
  );
};
